window.bookSummaryJSON = "<p><b>\"Laura Sebastian is the next Madeline Miller.... a fierce, fresh, lyrical tale that will enthrall until the last page.\" (Kate Quinn, </b><b><i>New York Times</i></b><b> bestselling author of </b><b><i>The Huntress</i></b><b>)</b> </p> <p><b>A Popsugar Best Summer Read of 2021</b></p> <p><b>A Bibliolifestyle Most Anticipated Summer 2021 Sci-Fi and Fantasy Book</b></p> <p><b>\"Magical, haunting, unique - I haven't been so excited about an Arthur book since I read </b><b><i>The Once and Future King</i></b><b>.\" (Tamora Pierce, number-one </b><b><i>New York Times </i></b><b>best-selling author)</b></p> <p><b>The Lady of Shalott reclaims her story in this bold feminist reimagining of the Arthurian myth from the </b><b><i>New York Times</i></b><b> best-selling author of </b><b><i>Ash Princess</i></b><b>.</b> </p> <p>Everyone knows the legend. Of Arthur, destined to be a king. Of the beautiful Guinevere, who will betray him with his most loyal knight, Lancelot. Of the bitter sorceress, Morgana, who will turn against them all. But Elaine alone carries the burden of knowing what is to come - for Elaine of Shalott is cursed to see the future.</p> <p>On the mystical isle of Avalon, Elaine runs free and learns of the ancient prophecies surrounding her and her friends - countless possibilities, almost all of them tragic.</p> <p>When their future comes to claim them, Elaine, Guinevere, Lancelot, and Morgana accompany Arthur to take his throne in stifling Camelot, where magic is outlawed, the rules of society chain them, and enemies are everywhere. Yet the most dangerous threats may come from within their own circle.</p> <p>As visions are fulfilled and an inevitable fate closes in, Elaine must decide how far she will go to change destiny - and what she is willing to sacrifice along the way.</p>"; 
